import React from 'react';
import { Table } from "reactstrap";


const Footer = (props) => {
 
 
    return (

<Table borderless>
<thead> 
<tr>
<footer class="py-5 bg-dark">
<div class="container"><p class="m-0 text-center text-white">Copyright &copy; Aplicação 2021</p></div>
</footer>
</tr>
</thead> 
</Table>

    )
}

export default Footer;
